import { Injectable } from "@angular/core";
import { Observable } from "rxjs";
import { ReponseToken } from "../interface/reponseToken.interface";

@Injectable({
    providedIn: "root"
})
export class AuthService{
    private Token!: string;

    getToken():Observable<ReponseToken>{
        return this.Token;
    }
}
